import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar">
      <img src=".\assets\logo.png" alt="Logo" className="navLogo"/>
      <h1>QTales</h1>
      <div className="links">
        <Link to="/">Home</Link>
        <Link to="/create">New Tale</Link>
      </div>
    </nav>
  );
};

export default Navbar;
